import React, { useState } from "react";
import axios from "axios";
import "./admin.css";

function Admin() {
  const [formValues, setFormValues] = useState({
    ipoName: '',
    overview: '',
    img: '',
    Type: '',
    ipoDetails: {
      ipoDate: '',
      listingDate: '',
      faceValue: '',
      priceBand: '',
      lotSize: '',
      totalIssueSize: '',
      offerForSale: '',
      employeeDiscount: '',
      issueType: '',
      listingAt: '',
      shareHoldingPreIssue: '',
      shareHoldingPostIssue: '',
    },
    ipoTimeline: {
      ipoOpenDate: '',
      ipoCloseDate: '',
      basisOfAllotment: '',
      initiationOfRefunds: '',
      creditOfSharesToDemat: '',
      listingDate: '',
      cutoffTimeForUpiMandateConfirmation: '',
    },
    ipoReservation: '',
    investorCategory: {
      anchorInvestorSharesOffered: {
        anchorInvestorsharesOffered: '',
        anchorInvestormaximumAllottees: '',
      },
      qibSharesOffered: {
        qibSharesOfferedsharesOffered: '',
        qibSharesOfferedmaximumAllottees: '',
      },
      niiSharesOffered: {
        niiSharesOfferedsharesOffered: '',
        niiSharesOfferedmaximumAllottees: '',
      },
      bNiiSharesOffered: {
        bNiiSharesOfferedsharesOffered: '',
        bNiiSharesOfferedmaximumAllottees: '',
      },
      sNiiSharesOffered: {
        sNiiSharesOfferedsharesOffered: '',
        sNiiSharesOfferedmaximumAllottees: '',
      },
      retailSharesOffered: {
        retailSharesOfferedsharesOffered: '',
        retailSharesOfferedmaximumAllottees: '',
      },
      employeeSharesOffered: {
        employeeSharesOfferedsharesOffered: '',
        employeeSharesOfferedmaximumAllottees: '',
      },
      totalSharesOffered: {
        totalSharesOfferedsharesOffered: '',
        totalSharesOfferedmaximumAllottees: '',
      },
    },
    ipoLotSize: {
      description: '',
      retailMin: {
        retailMinlot: '',
        retailMinshare: '',
        retailMinprice: '',
      },
      retailMax: {
        retailMaxlot: '',
        retailMaxshare: '',
        retailMaxprice: '',
      },
      sHniMin: {
        sHniMinlot: '',
        sHniMinshare: '',
        sHniMinprice: '',
      },
      sHniMax: {
        sHniMaxlot: '',
        sHniMaxshare: '',
        sHniMaxprice: '',
      },
      bHniMin: {
        bHniMinlot: '',
        bHniMinshare: '',
        bHniMinprice: '',
      },
    },
    ipoAnchorInvestorsDetails: {
      bidDate: '',
      sharesOffered: '',
      anchorPortionSize: '',
      anchorLockInPeriodEndDate50: '',
      anchorLockInPeriodEndDate90: '',
    },
    ipoPromotorHolding: {
      description: '',
      shareHoldingPreIssue: '',
      shareHoldingPostIssue: '',
    },
    about: '',
    limitedFinancialInformation: {
      description: '',
      periodEnded: [],
      assets: [],
      revenue: [],
      profitAfterTax: [],
      netWorth: [],
      reservesAndSurplus: [],
      totalBorrowing: [],
    },
    keyPerformanceIndicators: {
      description: '',
      roe: '',
      roce: '',
      debtEquity: '',
      ronw: '',
      pbv: '',
      patMargin: '',
      eps: '',
      pe: '',
    },
    objectsOfTheIssue: '',
    limitedContactDetails: '',
    ipoRegistrar: '',
    ipoSharesOffered: {
      anchorInvestor: '',
      qib: '',
      nii: '',
      bNii: '',
      sNii: '',
      retail: '',
      employee: '',
    },
    ipoInvestorCategories: '',
